//convert number to word for expected sale price
function intToWords(rawValue) {
    var num = parseInt(rawValue, 10), // Ensure num is an integer
        a = ['', 'One ', 'Two ', 'Three ', 'Four ', 'Five ', 'Six ', 'Seven ', 'Eight ', 'Nine ', 'Ten ', 'Eleven ', 'Twelve ', 'Thirteen ', 'Fourteen ', 'Fifteen ', 'Sixteen ', 'Seventeen ', 'Eighteen ', 'Nineteen '],
        b = ['', '', 'Twenty ', 'Thirty ', 'Forty ', 'Fifty ', 'Sixty ', 'Seventy ', 'Eighty ', 'Ninety '],
        c = ['Billion', 'Million', 'Thousand', ''],
        words = '';

    if (isNaN(num) || num < 0) return 'Invalid number';

    if (num === 0) return 'Zero';

    // Split the number into groups of three digits
    var groups = ('000000000' + num).slice(-12).match(/.{3}/g);

    for (var i = 0; i < groups.length; i++) {
        var n = parseInt(groups[i], 10);
        if (n === 0) continue; // Skip empty groups

        var groupText = '';
        if (n >= 100) {
            groupText += a[Math.floor(n / 100)] + 'Hundred ';
            n = n % 100;
        }
        if (n >= 20) {
            groupText += b[Math.floor(n / 10)];
            n = n % 10;
        }
        if (n > 0) {
            groupText += a[n];
        }

        // Append the corresponding scale (Billion, Million, Thousand, etc.)
        groupText += c[c.length - groups.length + i] ? c[c.length - groups.length + i] + ' ' : '';

        words += groupText;
    }

    return words.trim().replace(/\s+/g, ' '); // Clean up spaces
}

$(document).ready(function () {
    // Define controls using Runner.getControl
    var ctrlSalePrice = Runner.getControl(pageid, 'expected_sale_price');
    var ctrlPriceText = Runner.getControl(pageid, 'expected_sale_price_text');

    // Add event listener for keyup on expected_sale_price
    ctrlSalePrice.on('keyup', function () {
        var inputText = ctrlSalePrice.getValue().trim(); // Get the value of the control
        var number = parseInt(inputText, 10); // Convert input to a number
        if (!isNaN(number)) {
            // Set the text value of the corresponding control
            ctrlPriceText.setValue(intToWords(number));
        } else {
            ctrlPriceText.setValue('Invalid number');
        }
    });
});


